import React,{useState,useEffect} from "react";
import { TodoType } from "./todo";
import axios from "axios"
const User = () => {
  const people = [
    {
      name: "Leslie Alexander",
      email: "leslie.alexander@example.com",
      role: "Co-Founder / CEO",
      imageUrl:
        "https://images.unsplash.com/photo-1494790108377-be9c29b29330?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
      lastSeen: "3h ago",
      lastSeenDateTime: "2023-01-23T13:23Z",
    },
    {
      name: "Michael Foster",
      email: "michael.foster@example.com",
      role: "Co-Founder / CTO",
      imageUrl:
        "https://images.unsplash.com/photo-1519244703995-f4e0f30006d5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
      lastSeen: "3h ago",
      lastSeenDateTime: "2023-01-23T13:23Z",
    },
    {
      name: "Dries Vincent",
      email: "dries.vincent@example.com",
      role: "Business Relations",
      imageUrl:
        "https://images.unsplash.com/photo-1506794778202-cad84cf45f1d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=2&w=256&h=256&q=80",
      lastSeen: null,
    },


  ];
  const [data,setData]=useState<TodoType[]>([])
  const [plan,setPlaning]= useState<any>({});
  const fetchData=async()=>{
    try {
        const response=await axios.get("http://localhost:9363/post/panel");
         setData(response.data)
         setPlaning(response.data.planing)
    } catch (error) {
         console.log(error)
    }
  }
useEffect(()=>{
    fetchData()
},[])
  return (
    <div className="grid gap-3  md:grid-cols-3">
      <ul className="list-disc">
        <li>
          Now this is a story all about how, my life got flipped-turned upside
          down
        </li>
        <li>
          Now this is a story all about how, my life got flipped-turned upside
          down
        </li>
        <li>
          Now this is a story all about how, my life got flipped-turned upside
          down
        </li>
      </ul>

      <ol className="list-decimal">
        <li>
          Now this is a story all about how, my life got flipped-turned upside
          down
        </li>
      </ol>

      <ul className="list-none pr-3">
        <ul role="list" className="divide-y divide-gray-700">
          {people.map((person) => (
            <li
              key={person.email}
              className="flex justify-between gap-x-6 py-5"
            >
              <div className="flex min-w-0 gap-x-4">
                <img
                  className="h-12 w-12 flex-none rounded-full bg-gray-50"
                  src={person.imageUrl}
                  alt=""
                />
                {data.map((item,index)=>{
                    return(
                        <div className="min-w-0 flex-auto">
                        <p className="text-sm font-semibold leading-6 text-gray-900">
                          {item.kullaniciAd}
                        </p>

                      </div>
                    )
                })}

              </div>
              <div className="hidden shrink-0 sm:flex sm:flex-col sm:items-end">

                {plan.planing !==null ? (
                  <p className="mt-1 text-xs leading-5 text-gray-500">
                    Last seen{" "}
                    <time dateTime={new Date(plan.planing).toLocaleString()}>

                    </time>
                  </p>
                ) : (
                  <div className="mt-1 flex items-center gap-x-1.5">
                    <div className="flex-none rounded-full bg-emerald-500/20 p-1">
                      <div className="h-1.5 w-1.5 rounded-full bg-emerald-500" />
                    </div>
                    <p className="text-xs leading-5 text-gray-500">Online</p>
                  </div>
                )}
              </div>
            </li>
          ))}
        </ul>
      </ul>
    </div>
  );
};

export default User;
